@mediabanco Todos los partidos políticos son matones, no sólo RN. En TODOS los partidos políticos se pasa al Consejo Político para expulsar a quienes apoyen a otros candidatos que no sean los de ese partido.
Yo nunca más estaría en un partido político, justamente por ese mismo motivo.

